import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import './App.css';
import Layout from './hocs/Layout'
import Navbar from './Navbar/Navbar';
import Footer from './footer/Footer';
import Home from './Home';
import AboutUs from './Nav-Links/AboutUs';
import ContactUs from './Nav-Links/ContactUs';

//Computing and Engineering Sciences
// import ComputingSteps from './ComputingSteps/ComputingSteps';
import Requirements from './ComputingSteps/Requirements';
import SchoolOfficer from './ComputingSteps/SchoolOfficer';
import HeadOfDepartment from './ComputingSteps/HeadOfDepartment';
import BabcockUniversityTeachingHospital from './ComputingSteps/BabcockUniversityTeachingHospital';
import DirectorStudentSupportServices from './ComputingSteps/DirectorStudentSupportServices';
import DirectorSecurityServices from './ComputingSteps/DirectorSecurityServices';
import DataandArchievesOfficer from './ComputingSteps/DataandArchievesOfficer';
import AdmissionsOfficer from './ComputingSteps/AdmissionsOfficer';
import SchoolOfficer2 from './ComputingSteps/SchoolOfficer2';

//Mass Comm
import MassSteps from './MassSteps/MassSteps';
import Requirements1 from './MassSteps/Requirements1';
import SchoolOfficer1 from './MassSteps/SchoolOfficer1';
import HeadOfDepartment1 from './MassSteps/HeadOfDepartment1';
import BabcockUniversityTeachingHospital1 from './MassSteps/BabcockUniversityTeachingHospital1';
import DirectorStudentSupportServices1 from './MassSteps/DirectorStudentSupportServices1';
import DirectorSecurityServices1 from './MassSteps/DirectorSecurityServices1';
import DataandArchievesOfficer1 from './MassSteps/DataandArchievesOfficer1';
import AdmissionsOfficer1 from './MassSteps/AdmissionsOfficer1';
import SchoolOfficer3 from './MassSteps/SchoolOfficer3';

import Scrolltotopofsteps from './scrolltotop/scrolltotopofsteps';
import SignUp from './accounts/SignUp';
import LogIn from './accounts/LogIn';
import SelectCourse from './SelectCourse';
import NotFound from './NotFound';
// import Activate from './accounts/Activate';

// import PrivateRoute from './Route';
// import ResetPassword from './accounts/ResetPassword';
// import ResetPasswordConfirm from './accounts/ResetPasswordConfirm';
// import ResetLink from './accounts/ResetLink';
// import ActivateLink from './accounts/ActivateLink';
import Cover from './Cover';

function App() {
  return (
      <Router>
        <Layout>
          <div className="App">
            <Scrolltotopofsteps />
            <Navbar></Navbar>
            <div className="content">
              <Switch>
                <Route exact path = '/'>
                    <Home />
                    <Footer></Footer>
                </Route>

                <Route path = '/AboutUs'>
                    <AboutUs />
                    <Footer></Footer>
                </Route>

                <Route path = '/ContactUs'>
                    <ContactUs />
                    <Footer></Footer>
                </Route>

                {/* <Route path = '/Successful' component = {Successful} /> */}

                {/* Computing and engineering sciences*/}
                <Route path = '/ComputingSteps' component = {Cover} />
                <Route path = '/Requirements' component = {Requirements} />
                <Route path = '/SchoolOfficer' component = {SchoolOfficer} />
                <Route path = '/HeadOfDepartment' component = {HeadOfDepartment} />
                <Route path = '/BabcockUniversityTeachingHospital' component = {BabcockUniversityTeachingHospital} />
                <Route path = '/DirectorStudentSupportServices'  component = {DirectorStudentSupportServices} />
                <Route path = '/DirectorSecurityServices'  component = {DirectorSecurityServices} />
                <Route path = '/DataandArchievesOfficer'  component = {DataandArchievesOfficer} />
                <Route path = '/AdmissionsOfficer'  component = {AdmissionsOfficer} />
                <Route path = '/SchoolOfficer2'  component = {SchoolOfficer2} />

                {/*Mass Comm*/}
                <Route path = '/MassSteps' component = {MassSteps} />
                <Route path = '/Requirements1' component = {Requirements1} />
                <Route path = '/SchoolOfficer1' component = {SchoolOfficer1} />
                <Route path = '/HeadOfDepartment1' component = {HeadOfDepartment1} />
                <Route path = '/BabcockUniversityTeachingHospital1' component = {BabcockUniversityTeachingHospital1} />
                <Route path = '/DirectorStudentSupportServices1'  component = {DirectorStudentSupportServices1} />
                <Route path = '/DirectorSecurityServices1'  component = {DirectorSecurityServices1} />
                <Route path = '/DataandArchievesOfficer1'  component = {DataandArchievesOfficer1} />
                <Route path = '/AdmissionsOfficer1'  component = {AdmissionsOfficer1} />
                <Route path = '/SchoolOfficer3'  component = {SchoolOfficer3} />

                {/*Authentication*/}
                <Route path = '/SignUp' component = {SignUp} />
                <Route path = '/LogIn' component = {LogIn} />
                {/* <Route path = '/reset-password' component = {ResetPassword} /> */}
                {/* <Route path = '/password/reset/confirm/:uid/:token' component = {ResetPasswordConfirm} /> */}
                {/* <Route path = '/ResetLink' component = {ResetLink} /> */}
                {/* <Route path = "/activate/:uid/:token" component = {Activate} /> */}
                {/* <Route path = '/ActivateLink' component = {ActivateLink} /> */}
                <Route path = "/SelectCourse" component = {SelectCourse} />

                {/* <Route path = "/Computing" component = {Computing} />
                <Route path = "/MassComm" component = {MassComm} /> */}

                <Route path = "*" component = {NotFound} />
              </Switch>
            </div>
          </div>
        </Layout>
      </Router>
  );
}

export default App;
